import java.util.*;

class Solution {
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }

        Map<Character, Integer> mapS = this.getCharMap(s);
        Map<Character, Integer> mapT = this.getCharMap(t);

        if (mapS.size() != mapT.size()) {
            return false;
        }

        for (Character c : mapS.keySet()) {
            Integer sCount = mapS.get(c);
            Integer tCount = mapT.get(c);

            if (!sCount.equals(tCount)) {
                return false;
            }
        }

        return true;
    }

    private Map<Character, Integer> getCharMap(String s) {
        Map<Character, Integer> map = new HashMap<Character, Integer>();

        for (Character c : s.toCharArray()) {
            map.put(c, map.getOrDefault(c, 0) + 1);
        }

        return map;
    }

    public static void main(String[] args) {
        String s = "";
        String t = "";

        Boolean result = new Solution().isAnagram(s, t);

        System.out.println("Result: " + result);
    }
}